import React from 'react';
import { Col } from 'reactstrap';

const Thumbnail = (props)=>{
    return(
        <Col xs="4"> 
            <img src={props.image} alt="projects"/> 
            <h4>{props.projectTitle}</h4>
            <p>{props.projectDate}</p>
        </Col>
    );
};

export default Thumbnail;
